import { useState } from 'react';

const App = (props) => {
  const [name, setName] = useState('');

  return(
    <div>
      <h2>Enter you name:</h2>
      <input type="text"
             value={name}
             placeholder="your name"
             onChange={ (e) => setName(e.target.value)} />
      <h1>Hello, {name}</h1>       
    </div>
  );

}

export default App;
